import React from 'react';
import { Grid, Typography, Button, Container, FormControl, TextField} from '@material-ui/core';

const templateGenerator = ()=>{

    return(
    <Container style={{backgroundColor:'white'}} width="sm">
      <form  noValidate autoComplete="off">
      <Grid container spacing={3} direction="column" justify="space-between" alignItems="center" >
      <Grid item xs={12} sm={6}>
      <TextField required id="standard-required" label="Your Name" defaultVale="Prakhar Ojha" />
      </Grid>
      <Grid item xs={12} sm={6}><TextField required id="standard-required" label="College Name" defaultVale="IIIT Surat" /></Grid>
      <Grid item xs={12} sm={6}><TextField required id="standard-required" label="Branch" defaultVale="ECE" /></Grid>
      <Grid item xs={12} sm={6}><TextField required id="standard-required" label="Batch" defaultVale="A2" /></Grid>
      </Grid>
      <Grid container spacing={3} direction="column">
      <Grid item xs={12} sm={6}><TextField required id="standard-required" label="Aim" defaultVale="The aim of the experiment is" /></Grid>
      </Grid>
      </form>
      </Container>
      
      
    );
}

export default templateGenerator;
